import React, { useState } from 'react';

const Meme = ({id,image,info,price,name}) => {

  return (<article className="single-meme">
    <footer>
      <div className="meme-info">
        <h4>{name}</h4>
        <h4 className="meme-price">{price}</h4>
        <button className="meme-price">Edit</button>
      </div>
      <p>{info}</p>
    </footer>
    <img src={image} alt={name}/>

  </article>);
};

export default Meme;
